import React from 'react';
import '../App.css';
import { sidebarData } from './sidebarData.js';

function SideBar() {
  return (
    
    <div className='BarSide'>
        <ul>
            {sidebarData.map((val,key) => {
                return(
                    <li key={key} onClick={()=>window.location.pathname = val.link}>
                        
                        <div>{val.icon}</div>
                        
                    </li>



                )
            })}
        </ul>
    </div>
  )
  function SideBar(){
    <div className=''></div>
  }
    

    
        

   


    
  
}

export default SideBar
